import { useSelector } from "react-redux"
import { NavLink } from "react-router-dom"

export const Nav = () => {
const log=useSelector(s=>s.datareducerL.isManager)
const logn=useSelector(s=>s.datareducerL.currentUser)
console.log(logn);


    return <div> 
        <nav style={{backgroundColor:"#8B5A2B"}}>
    
    <ul className="nav nav-pills nav-justified"  style={{backgroundColor:"8B5A2B",zIndex: "10"
         }}>
        {log&&<li className="nav-item">
            <NavLink className="nav-link active" to="liG">לרשימת המשחקים</NavLink>
        </li>}
        {log&& <li className="nav-item">
            <NavLink className="nav-link" to="liC">לרשימת הקטגוריות</NavLink>
        </li>}
       {log&&<li className="nav-item">
            <NavLink className="nav-link" to="addC/undefined">להוספת קטגוריות</NavLink>
        </li>}
        {log&&<li className="nav-item">
            <NavLink className="nav-link" to="addG/undefined">להוספת משחקים</NavLink>
        </li>}
       {!logn==""&&<li className="nav-item">
            <NavLink className="nav-link" to="per">לאיזור האישי</NavLink>
        </li>}
       { !log&&<li className="nav-item">
            <NavLink className="nav-link" to="Login">כניסה</NavLink>
        </li>}
        {!log&&<li className="nav-item">
            <NavLink className="nav-link" to="homeP">דף הבית</NavLink>
        </li>}
        {!log&&<li className="nav-item">
           <NavLink className="nav-link" to="/sign">להרשמה</NavLink>
        </li>}
      {!log&&<li className="nav-item">
            <NavLink className="nav-link" onClick={()=>{debugger}} to="sal">לסל הקניות שלי</NavLink>
        </li>}
        
    </ul><br></br>
    </nav>{log&& <p>שלום מנהל</p>}
        {!log&&<p>{logn.CusName} שלום ל</p>}
    </div>
}
